import React from 'react'
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom';


export default function NavBar() {
  return (

    <Navbar expand="lg" data-bs-theme="green" className="bg-body-tertiary">
    <Container>
      <Navbar.Brand href="/" style={{marginLeft: '-1.5cm'}}>Labify</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="me-auto">
         
          <NavDropdown style={{marginLeft: '31.5cm', marginRight:'0.3cm'}} title="Login" id="basic-nav-dropdown">
            <NavDropdown.Item href="/loginStd" >I'm a student</NavDropdown.Item>
            <NavDropdown.Item  href="/loginIns">
             I'm a teacher
            </NavDropdown.Item>
            
          </NavDropdown>

          <NavDropdown title="Register" id="basic-nav-dropdown">
            <NavDropdown.Item href="/registerStd" >I'm a student</NavDropdown.Item>
            <NavDropdown.Item href="/registerIns">
             I'm a teacher
            </NavDropdown.Item>
            
          </NavDropdown>
        </Nav>
      </Navbar.Collapse>
    </Container>
  </Navbar>
    
  )
}
